import React, { Component } from 'react';

class Liste extends Component {

    constructor(props) {
      super(props);
      this.state = {
        error: null,
        isLoaded: false,
        item: [],
      };
    }
    componentDidMount() {
      var request = new Request('http://localhost:8080/');
      fetch(request, {mode: 'no-cors'})
        .then(function(response) {
          this.setState({
            isLoaded: true,
            item: result.items

          });
          console.log(response); 
        }).catch(function(error) { 
          this.setState({
            isLoaded: true,
            error
          });
          console.log('Request failed', error)  
        });
      fetch("Access-Control-Allow-Origin:http://localhost:8080/",)
        .then(res => res.json())
        .then(
          (result) => {
            this.setState({
              isLoaded: true,
              item: result.items

            });
          },

          (error) => {
            this.setState({
              isLoaded: true,
              error
            });
          }
        )
    }

    render() {
      const { error, isLoaded, items } = this.state;
      if (error) {
        return <div>Error: {error.message}</div>;
      } else if (!isLoaded) {
        return <div>Loading...</div>;
      } else {
        return (
          <ul>
            {items.map(item => (
              <li key={item.nom}>
                {item.nom} {item.prenom}
                console.log(item.nom);
              </li>
            ))}
          </ul>
        );
      }
    }
  }

export default Liste;
